					["custom"] = "-- optional AirHorn!\naura_env.airhorn = true -- true or false\n\n-- Or you can change the AirHorn if you really want an inferior sound\naura_env.sound = [[Interface\\AddOns\\WeakAuras\\Media\\Sounds\\AirHorn.ogg]]\n\n-- Cast Bar colour (values between 0 and 1 - alpha mean opacity, 1 is full, 0 is invisible :P )\nlocal red, green, blue, alpha = 1, 1, 1, 0.7\n\n---------------------\n\nlocal bar = WeakAuras.regions[aura_env.id].region.bar\n\nif not bar.cast then\n    local cast = bar:CreateTexture(nil, \"ARTWORK\");\n    cast:SetDrawLayer(\"ARTWORK\", 3);\n    bar.cast = cast;\nend\nbar.cast:SetTexture(\"Interface\\\\AddOns\\\\WeakAuras\\\\Media\\\\Textures\\\\Square_White.tga\")\nbar.cast:SetVertexColor(red, green, blue, alpha)\nbar.cast:SetWidth(50);\nbar.cast:SetHeight(math.max(3, bar:GetHeight()/4));\nbar.cast:ClearAllPoints()\nbar.cast:SetPoint(\"TOPLEFT\", bar, \"TOPLEFT\", 0,1)\n\nWeakAuras.regions[aura_env.id].region.text:SetPoint(\"BOTTOMLEFT\", WeakAuras.regions[aura_env.id].region, \"BOTTOMLEFT\", 0,3)\nWeakAuras.regions[aura_env.id].region.timer:SetPoint(\"BOTTOMRIGHT\", WeakAuras.regions[aura_env.id].region, \"BOTTOMRIGHT\", 0,3)",
