					["alphaFunc"] = "function(progress, start, delta)\n    \n    if aura_env\n    and aura_env.state\n    and aura_env.state.name == \"heading\"\n    and aura_env.state.expirationTime - GetTime() < aura_env.flash\n    and aura_env.potted == false\n    then\n        \n        local angle = (progress * 2 * math.pi) - (math.pi / 2)\n        return start + (((math.sin(angle) + 1)/2) * delta)\n    end\n    \n    return start\nend\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
