					["custom"] = "aura_env.counter = 0\naura_env.lowest = {\n    nil, --sid\n    nil, --tminus\n    nil, --sname\n    nil --icon\n}\naura_env.spells = {\n    select(1,GetSpellInfo(774)), --Rejuvenation\n    select(1,GetSpellInfo(33763)), --Lifebloom\n    select(1,GetSpellInfo(48438)), --Wild Growth\n    select(1,GetSpellInfo(155777)), --Germination\n    select(1,GetSpellInfo(8936)), --Regrowth\n    select(1,GetSpellInfo(200389)), --Cultivation\n    select(1,GetSpellInfo(102351)), --Cenarion Ward\n    select(1,GetSpellInfo(207386)) --Spring Blossoms\n}\nfunction aura_env.uCheck(uid)    \n    if UnitName(uid) then\n        for i = 1, #aura_env.spells do\n            local sname = aura_env.spells[i]\n            if UnitBuff(uid, sname, nil, \"PLAYER\") then\n                local name = select(1, UnitBuff(uid, sname, nil, \"PLAYER\")) \n                local icon = select(3, UnitBuff(uid, sname, nil, \"PLAYER\"))\n                local expt = select(7, UnitBuff(uid, sname, nil, \"PLAYER\"))\n                local sid = select(11, UnitBuff(uid, sname, nil, \"PLAYER\"))\n                local durLeft = expt - GetTime()\n                aura_env.counter = aura_env.counter + 1\n                if durLeft < (aura_env.lowest[2] or 999) then\n                    aura_env.lowest = {sid, durLeft, name, icon}\n                end\n            end\n        end\n    end\nend",
