			["customText"] = "function()\n    \n    local count = aura_env.count or 0\n    if count > 0 then\n        for i=1,count,1 do\n            local bar = _G[\"wildimpBar\"..i]\n            if bar  then\n                local expires = bar.expires\n                local countdown = expires-GetTime()\n                if expires and countdown > 0 then\n                    bar:SetValue(countdown)\n                    bar.spark:ClearAllPoints()\n                    bar.spark:SetPoint(\"CENTER\", bar, \"LEFT\", (countdown/aura_env.duration)*aura_env.width, 0);\n                else\n                    for j=1,count-1,1 do\n                        _G[\"wildimpBar\"..(j)].expires = _G[\"wildimpBar\"..(j+1)].expires\n                        _G[\"wildimpBar\"..(j)]:SetStatusBarColor(_G[\"wildimpBar\"..(j+1)]:GetStatusBarColor())\n                    end\n                    _G[\"wildimpBar\"..(count)]:Hide()\n                    _G[\"wildimpBar\"..(count)].spark:SetVertexColor(0,0,0,0)\n                    aura_env.count = count -1      \n                end\n            end\n        end\n    end\n    \n    return nil\nend\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
