				["custom"] = "function(_,time,type,_,sguid,_,_,_,_,name,_,_,_,spell)\n    local build = function(count)\n        local duration = aura_env.duration\n        local barName = \"wildimpBar\"..count\n        if not _G[barName] then\n            _G[barName] = CreateFrame(\"StatusBar\",barName,WeakAuras.regions[aura_env.id].region)\n            local bar = _G[barName]\n            bar:SetHeight(aura_env.height)\n            bar:SetWidth(aura_env.width)\n            bar:SetPoint(\"TOPLEFT\",WeakAuras.regions[\"ol Wild Imps UP\"].region,\"TOPLEFT\",0,0)--count*aura_env.height*-1)\n            bar:SetFrameStrata(\"BACKGROUND\")\n            bar:SetFrameLevel(100-count)\n            bar:SetStatusBarTexture(LibStub(\"LibSharedMedia-3.0\"):Fetch(\"statusbar\", aura_env.texture) or \"\")\n            bar:SetBackdrop({bgFile = \"None\",\n                    edgeFile = LibStub(\"LibSharedMedia-3.0\"):Fetch(\"border\", aura_env.borderEdge) or \"\",\n                    tile = false, tileSize = 0, edgeSize = 1, barInFront = true,\n                    insets = { left = 1, right = 0, top = 0, bottom = 0 }})\n            bar:SetBackdropColor(0,0,0,0) --not using\n            bar:SetBackdropBorderColor(0,0,0,1)\n            bar.duration = duration\n            bar:SetMinMaxValues(0, duration)\n            local spark = bar:CreateTexture(nil, \"ARTWORK\")\n            spark:SetDrawLayer(\"ARTWORK\", 3)\n            bar.spark = spark\n            bar.spark:SetTexture(aura_env.sparkTexture)\n            bar.spark:SetWidth(aura_env.sparkWidth)\n            bar.spark:SetHeight(aura_env.height)\n            bar.spark:SetPoint(\"CENTER\", bar, \"LEFT\", aura_env.width, 0)\n            if count == 1 then\n                local bg = _G[barName]:CreateTexture(nil, \"BACKGROUND\", nil, -8)\n                bar.bg = bg\n                bar.bg:SetTexture(LibStub(\"LibSharedMedia-3.0\"):Fetch(\"statusbar\", aura_env.texture) or \"\")\n                local bgc = aura_env.bgc\n                bar.bg:SetVertexColor(bgc[1],bgc[2],bgc[3],bgc[4])\n                bar.bg:SetHeight(aura_env.height)\n                bar.bg:SetWidth(aura_env.width)\n                bar.bg:SetPoint(\"CENTER\", bar, \"CENTER\", 0, 0)\n            end\n        end\n        local bar = _G[barName]\n        \n        -- Need to be set again on each Imp spawn\n        bar.expires = GetTime()+duration\n        bar:SetValue(duration)\n        local bc = aura_env.bc\n        bar:SetStatusBarColor(bc[1],bc[2],bc[3],1)\n        bar.spark:SetPoint(\"CENTER\", bar, \"LEFT\", aura_env.width, 0)\n        local sparkColor = aura_env.sparkColor\n        bar.spark:SetVertexColor(sparkColor[1], sparkColor[2], sparkColor[3], sparkColor[4])\n        bar:Show()\n        --\n        \n    end\n    if type == \"SPELL_SUMMON\" and sguid == aura_env.pguid then\n        if (name == \"Wild Imp\" or name == \"Дикий бес\") then\n            if not aura_env.count then aura_env.count=0; end\n            aura_env.count = aura_env.count+1\n            build(aura_env.count)\n        end\n    end\n    if type == \"SPELL_INSTAKILL\" and sguid == aura_env.pguid then\n        if (name == \"Wild Imp\" or name == \"Дикий бес\") then\n            local count = aura_env.count\n            for i=count,1,-1 do\n                _G[\"wildimpBar\"..count].expires=GetTime()\n                local bc = aura_env.bc\n                _G[\"wildimpBar\"..count]:SetStatusBarColor(bc[1],bc[2],bc[3],1)\n            end\n        end\n    end\n    if type == \"SPELL_CAST_SUCCESS\" and sguid == aura_env.pguid then\n        if (spell == \"Demonic Empowerment\" or  spell == \"Демоническое усиление\") then\n            local data = WeakAuras.GetData(\"ol Demonic Empowerment\")\n            local c = data.barColor\n            WeakAuras.regions[\"ol Dreadstalkers UP\"].region.bar.fg:SetVertexColor(c[1],c[2],c[3],1)\n            local count = aura_env.count or 0\n            for i=1,count,1 do\n                _G[\"wildimpBar\"..i]:SetStatusBarColor(c[1],c[2],c[3],1)\n            end\n        end\n    end\n    return true\nend\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
