						["custom"] = "function()\n    -- lets check if we didnt skip COMBAT message about aura has been REMOVED and remove it mannualy\n    \n    -- we will do that with using est time\n    local time = GetTime()-0.3         --add 0.3s for ping issues or smth like that\n    \n    -- check if there any targets in table\n    if aura_env.T_num and aura_env.T_num > 0\n    then\n        -- check for all targets if there any estimated auras\n        for k,v in pairs (aura_env.Target.est) do\n            if v and v < time\n            then\n                --      print('rem:', k, aura_env.Target.GUID[k], aura_env.Target.est[k], aura_env.Target.buff[k])\n                aura_env.T_num = aura_env.T_num - 1\n                aura_env.Target.GUID[k] = nil\n                aura_env.Target.est[k] = nil\n                aura_env.Target.buff[k] = nil\n                -- if we removed all our auras, lets clear the tables\n                if aura_env.T_num == 0\n                then\n                    aura_env.delete = true\n                end\n            end  \n        end\n    end\n    \n    \n    -- if we have to clear tables lets do it\n    if aura_env.delete ~= nil and aura_env.delete\n    then\n        aura_env.Target = nil\n        aura_env.T_index = nil\n        aura_env.T_num = nil\n        aura_env.delete = false\n        --    print('clear all')\n    end\n    \n    return true\nend",
